window.bookSummaryJSON = "<p><b><i>The Hunger Games</i></b><b> meets </b><b><i>Children of Men</i></b><b>, in a riveting future fantasy where after female birth rates decline, girls, including Charlotte, are kept hidden by their parents. But when she’s discovered, it will take everything Charlotte has not only to survive, but to turn the tables on her captors.</b><br> <br> Birth rates dropped at an alarming rate, and within years, men across all realms grew restless and aggressive. Their desperation led to women being collected at birth and sold at auction, and humans gradually became sought after.<br> <br> Parents began hiding their daughters, birthing and stowing their females underground in a desperate attempt to keep them safe.<br> <br> Charlotte is one of them.<br> <br> Hidden from the men who would tear her family apart to get to her, she’s accepted that she’ll live her entire life within the thick walls of her childhood home.<br> <br> When the human government permits a large-scale raid, Charlotte is one of the unlucky women caught. Forced out of hiding and thrown into the home of three powerful demons, Charlotte must learn how to stay alive in a world she’s only experienced through stories from her parents.</p>"; 
